class IBar(interface):

    def bar(self, a, b, c):
        """blah blah blah"""
class IBaz(interface):

    def baz(self, b, z):
        """Baz from IBaz"""
@implements(IBaz, IBar)
class Foo(object):

    def bar(self, a, b, c):
        pass

    def baz(self, b, z):
        pass
assert IBar.isImplementedBy(Foo)
assert IBaz.isImplementedBy(Foo)
assert Foo.bar.__doc__ == 'blah blah blah'
assert Foo.baz.__doc__ == 'Baz from IBaz'
